import React from 'react';
import Footer from '../Footer/Footer';
import Header from '../Header/Header';
import Svg from '../Header/Svg/Svg';
import CardsSection from './Cards-Section/Cards-Section';



const Home = () => {
    return (
        <div className='App'>
            <div></div>
            <Header />
            
            <CardsSection />
            <Footer />

        </div>
    );
}

export default Home;
